import React from "react";

const ThreeDot = () => {
  return (
    <div className="three__dot">
      <span>.</span>
      <span>.</span>
      <span>.</span>
      <div className="three__dot-dropdown">
        <button>Edit</button>
        <button>Delete</button>
      </div>
    </div>
  );
};

export default ThreeDot;
